import { useState, useCallback } from 'react'; 
import { useNavigate, Link } from "react-router-dom"; 

export default function Home() { 
    return ( 
        <> 
        <div className='main'> 
            <NavBar/> 
        </div> 
        </>); 
} 


function NavBar(){ 
    const navigate = useNavigate(); 

    function handleNavClick(index){ 
        console.log(index); 
        if (index==1){ 
            navigate('/'); 
        } else if (index==2){ 
            navigate('/gallery'); 
        } else if (index==3){ 
            navigate('/login');  
        }
    }
    return(
        <nav>
            <button onClick={()=>handleNavClick(1)}>Home</button> 
            <button onClick={()=>handleNavClick(2)}>Gallery</button> 
            <button onClick={()=>handleNavClick(3)}>Login</button> 
        </nav>
    ); 
}
